import React from 'react'
import styled from 'styled-components'

const GridContainer = styled.div`
    grid-row-gap: 20px;
    grid-column-gap: 20px;
    grid-auto-rows: auto;
    grid-template-columns: 1fr 1fr;
`

function Landing3() {
  return (
    <div>
        <h2>Explore Celestia</h2>
        <GridContainer>
            <div>Explore the ecosystem</div>
            <div>Use Tia</div>
            <div>Run a light node</div>
        </GridContainer>
    </div>
  )
}

export default Landing3;
